import React from "react";
import { useAuth0 } from "@auth0/auth0-react";

const Login = () => {
    const { loginWithRedirect } = useAuth0();

    return (
        <div>
            <h2>Login Page</h2>
            <button onClick={() => loginWithRedirect()}>Login</button>
        </div>
    );
};

export default Login;
